import React, { Component } from "react";
import axios from "axios";
import "./style/Home.css";
import svg from "./svg-sources";
//import { Link } from "react-router-dom";

const server = "http://localhost:5000/api";

export default class Home extends Component {
  /* constructor(props) {
    super(props);

    this.state = {
      loginStats: false,
    };
  } */

  componentDidMount() {
    axios
      .get(`${server}/checkLogin`)
      .then((res) => {
        console.log(res.data);
        if (!res.data.login) {
          console.log("generate token");
          axios.post(`${server}/generateGuestToken`).then((res) => {
            console.log(res.data);
          });
        }
      })
      .catch((err) => console.log(err));
  }

  render() {
    return (
      <div>
        <div id="Welcome-div">
          <h3 id="hello">Hello,</h3>
          <p id="name">My Name is Rizky Saputra</p>
          <p id="and">And</p>
        </div>

        <div></div>
        <div>
          <h1>I</h1>
        </div>
        <div>
          <p>Am 24 Years Old</p>
          <p>Have graduated from university of Lampung</p>
          <p>in Electrical Engineering</p>
          <p>Live in Lampung Province</p>
          <p>Love Computer programming</p>
        </div>

        <h5 className="Heading">My Skills</h5>
        <div id="Skills">
          <ul>
            <li>{svg.javascript}Javascript</li>
            <li>
              {svg.reactjs}
              ReactJs
            </li>
            <li>
              {svg.express}
              Express
            </li>
            <li>
              {svg.mongoDB}
              MongoDB
            </li>
            <li>
              {svg.nodeJs}
              NodeJs
            </li>
            <li>
              {svg.matlab}
              Matlab
            </li>
            <li>
              {svg.arduino}
              Arduino
            </li>
            <li>
              {svg.bootstrap}
              Bootstrap
            </li>
          </ul>
        </div>
        <h3>Hope we can work together</h3>
        <div id="contacts">
          <h6>Contact me</h6>
          <ul>
            <li>Email: rizkysaputra000@gmail.com</li>
            <li>Phone: 082186326036</li>
            <li>WA: 082186326036</li>
            <li>Github: https://github.com/rizkysaputra4/</li>
          </ul>
        </div>
      </div>
    );
  }
}
